  false,\n\t\"url\": null,\n\t\"notes\": \"Productivity of prairie wetlands is maintained
  through the natural wet/dry climatic cycles of the region. Periodic drying is required
  to oxidize sediments and release nutrients that become tied up in unavailable forms
  after prolonged flooding. Additionally, plants germinate and grow on exposed mudflats
  providing substrates for invertebrate colonization after reflooding and releasing
  additional nutrients into the water as these plants decompose. Invertebrate production
  in natural wetlands is greatest shortly after droughts when wetlands refill, and
  substrates and nutrients are abundant. After reflooding, productivity gradually
  declines as plant material available for decomposition and nutrients become less
  available. In artificially managed wetlands, invertebrate production can be maximized
  through carefully planned drawdowns of water levels and subsequent reflooding events.
  Drawdowns conducted too soon when secondary production is still high can result
  in the loss of valuable nutrients from a system. Likewise, waiting too long between
  drawdowns can result in unnecessarily long time periods when the wetlands are unproductive.
  Timing of the drawdown during the summer also effects the composition of the plant
  community that develops on the exposed mudflat. In order to aid management efforts
  to maximize productivity of wetlands, in 2002 we initiated a study of aquatic invertebrate
  (i.e. secondary) production in several managed wetland units at the Lacreek National
  Wildlife Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
